armGroups.description:
An intervention previously studied in the ETUDES Center along with a computerized version of our As Safe As Possible intervention.

1. Safety Planning App for suicidal youth which enables a primary care provider to streamline the gold standard of care for those with current suicidality symptoms through an app;
2. Mental Health Screener questionnaire that gathers additional mental health symptoms, treatment preferences, and family's readiness for treatment engagement to help a primary care provider make a personalized, tailored treatment plan a suicidal youth is more likely to adhere to;
3. Text Messages which aims to provide texts for 2-3 weeks to motivate you to engage with the safety plan and recommended treatment following the patient visit.
4. cASAP is a computerized version of the As Safe As Possible intervention that offers self-led modules with psychoeducation about safety planning, cognitive-behavioral skills to cope with distress, and facilitate collaboration with parents.
